import React from 'react'
import { Bar } from '@reactchartjs/react-chart.js'
import { PromiseProvider } from 'mongoose'

export default function BarChart(props) {

    const dataPoints = {
        labels: data.labels,
        datasets: data.datasets,
      }
      
      const options = {
        responsive: true,
        scales: {
          yAxes: [
            {
              ticks: {
                beginAtZero: true,
              },
            },
          ],
        },
      }
      

      return (
        <div>
          <Bar data={dataPoints} options={options} />
        </div>
      )
}
